const img = [
  "data:image/png;base64,",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQOMZ98AZ9z1Y8er9-jXOGmrqdZDeCy6WtFxg&usqp=CAU",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,"
];

let cont = 1;
for (let i = 0; i < img.length; i++)
  document.querySelector(
    "#cont"
  ).innerHTML += `<img src="${img[i]}" alt="" class="images">`;

function colocar(event) {
  const boton = event.target;
  document.querySelector(
    "#imgPrincipal"
  ).style.backgroundImage = `url(${boton.src})`;
}

const botones = document.querySelectorAll(".images");

botones.forEach(function (boton) {
  boton.addEventListener("click", colocar);
});
